import axios from 'axios';

const POSTS_ENDPOINT = 'http://localhost:8030/api/posts';

export const createPost = async (post) => {
    try {
        const response = await axios.post(POSTS_ENDPOINT, post);
        return response.data;
    } catch (error) {
        console.error(error);
    }
}
